import React from 'react';

const Login = ({ navigateTo }) => {
  return (
    <div className="flex items-center justify-center min-h-screen text-white">
      <div className="w-full max-w-md p-6 bg-gray-900 rounded-md">
        <h2 className="text-2xl mb-4">Login (placeholder)</h2>
        <p className="mb-4">This is a simple placeholder for the Login component.</p>
        <button
          className="px-4 py-2 bg-indigo-600 rounded"
          onClick={() => navigateTo('home')}
        >
          Back to Home
        </button>
      </div>
    </div>
  );
};

export default Login;
